urange (select supp_nation, cust_nation, l_year, sum(volume) as revenue from (select name1 as supp_nation, name2 as cust_nation, date_part('year',l_shipdate) as l_year, l_extendedprice * (1 - l_discount) as volume from (select * from ((((((select n_nationkey as nk1, n_name as name1 from nation_radb is radb) join (select s_nationkey, s_suppkey from supplier_radb is radb) s1 on nk1 = s_nationkey) join (select l_shipdate, l_extendedprice, l_discount, l_suppkey, l_orderkey from lineitem_radb is radb where l_shipdate>'1995-01-01' and l_shipdate<'1996-12-31') on s_suppkey = l_suppkey) join (select o_orderkey, o_custkey from orders_radb is radb) on l_orderkey = o_orderkey) join (select c_custkey, c_nationkey from customer_radb is radb) on o_custkey = c_custkey) join (select n_nationkey as nk2, n_name as name2 from nation_radb is radb) on c_nationkey = nk2) where (name1 = 'FRANCE' and name2 = 'GERMANY') or (name1 = 'GERMANY' and name2 = 'FRANCE'))) group by supp_nation, cust_nation, l_year);